    .prgc {
      height: 36px;
      width: 36px;
      transform: rotate(-90deg);
      transform-origin: center center;
      will-change: transform;
      overflow: visible;
    }

    .prgc.prg-inf {
      animation: an-prgc 2000ms linear infinite both;
    }

    .prgc circle {
      stroke-dashoffset: calc(calc(100 + calc(var(--prg-p) * calc(var(--is-rtl) * 2 - 1))) * 114px / 100);
      stroke-dasharray: 114;
      stroke-width: 3px;
      fill: none;
      stroke: #4caf50;
      stroke: var(--clr-s, #4caf50);
      will-change: stroke-dashoffset, transform;
      transition-property: stroke-dashoffset;
      transition-duration: 500ms;
      transition-timing-function: cubic-bezier(0.4, 0, 0.2, 1);
      transform-origin: center center;
    }

    .prgc.prg-inf {
      animation: an-prgc 2000ms linear infinite both;
    }

    .prgc.prg-inf circle {
      animation: an-prg-crcl-rtl 1200ms infinite both;
    }

    @keyframes an-prgc {
      0% {
        transform: rotate(0deg);
      }

      to {
        transform: rotate(calc(-360deg * calc(2 - 1)));
      }
    }

    @keyframes an-prg-crcl-rtl {
      0% {
        stroke-dashoffset: -20;
        transform: rotate(-30deg);
      }

      50% {
        stroke-dashoffset: -110;
        transform: rotate(-360deg);
      }

      to {
        stroke-dashoffset: -20;
        transform: rotate(-390deg);
      }
    }

    @keyframes an-prg-inf-a-rtl {
      0% {
        left: 100%;
        right: -25%;
      }

      25% {
        left: 0%;
        right: 25%;
      }

      75% {
        left: 0%;
        right: 150%;
      }

      to {
        left: 0%;
        right: 150%;
      }
    }

    @keyframes an-prg-inf-b-rtl {
      0% {
        left: 100%;
        right: -50%;
      }

      40% {
        animation-timing-function: cubic-bezier(0.4, 0.6, 0.6, 0.9);
        left: 100%;
        right: -100%;
      }

      75% {
        left: -10%;
        right: 100%;
      }

      to {
        left: -50%;
        right: 125%;
      }
    }

    .loading {
      position: fixed;
      left: 0;
      bottom: 0;
      right: 0;
      top: 0;
      display: flex;
      align-items: center;
      justify-content: center;
    }
  </style>
